import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the featured products grid to appear (uses ID selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card by using a CSS selector for the product card inside #productsGrid
    const productCard = await page.$('#productsGrid .product-card');
    if (!productCard) throw new Error('No product card found in featured products');

    // Click the first product card to open the product detail modal
    await productCard.click();

    // Wait for the product detail modal to appear (uses ID selector)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Wait for the "Add to Wish List" button using button text content (text selector)
    const wishlistBtn = await page.waitForSelector('button:has-text("Add to Wish List")', { timeout: 5000 });

    // Take screenshot before clicking "Add to Wish List"
    const step2 = path.join(screenshotsDir, 'step_2_product_detail.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Add to Wish List" button
    await wishlistBtn.click();

    // Wait for the notification to appear (uses class selector for .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    const step3 = path.join(screenshotsDir, 'step_3_after_add_wishlist.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the notification text to verify success
    const notificationText = await page.$eval('.notification.success', el => el.textContent);

    // Open the wishlist page by clicking the "Your Wish List" link (use first visible occurrence)
    const wishlistLinks = await page.$$('a');
    let wishlistLinkFound = false;
    for (const link of wishlistLinks) {
      const text = await link.evaluate(el => el.textContent.trim());
      if (text === 'Your Wish List') {
        await link.click();
        wishlistLinkFound = true;
        break;
      }
    }
    if (!wishlistLinkFound) throw new Error('Could not find "Your Wish List" link');

    // Wait for the wishlist page to load (wait for .wishlist-page)
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });

    // Take screenshot of the wishlist page
    const step4 = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the titles of products in the wishlist
    const wishlistTitles = await page.$$eval('.wishlist-title', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Added first product to wishlist and verified it appears in the wishlist page",
      extractedData: {
        notificationText,
        wishlistTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
